INSERT INTO `secciones` (`id`, `titulo`, `texto`, `imagen`, `link`, `textoboton`, `seccion`, `updated_at`) VALUES
	(1, 'Nosotros', '<p><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjM3MjUyODI0NywiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Real Química es una empresa de raíz </span></p><p><span style="white-space-collapse: preserve;">electroquímica y su nombre original al comienzo de</span></p><p><span style="white-space-collapse: preserve;"> sus actividades fue Laboratorio Argentino de </span></p><p><span style="white-space-collapse: preserve;">Investigación Galvanotécnica.<br><br>Fundada 1973, su principal objetivo fue el de llevar</span></p><p><span style="white-space-collapse: preserve;"> la avanzada en la investigación, el desarrollo, y la </span></p><p><span style="white-space-collapse: preserve;">puesta en marcha de nuevas tecnologías para el </span></p><p><span style="white-space-collapse: preserve;">tratamiento de superficies; manifestando una </span></p><p><span style="white-space-collapse: preserve;">marcada vocación de para el desarrollo </span><span style="white-space-collapse: preserve; background-color: var(--bs-body-bg); text-align: var(--bs-body-text-align);">de la</span></p><p><span style="white-space-collapse: preserve; background-color: var(--bs-body-bg); text-align: var(--bs-body-text-align);"> industria nacional.</span></p>', 'fotos/y31EItd8SJvxvKdcyrNzUteo5tZiDJW5kc5P3w2d.png', 'undefined', 'undefined', 'home', '2024-05-22 15:00:24'),
	(2, 'Sobre nosotros', '<span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiUzh4cFJxSmNsY3pDWGNRcFo0ckQxbSIsInBhc3RlSUQiOjY5NzU5NDIxOCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjEyNzcwOTM5MywiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Real Quimica es una empresa de raíz electroquímica y su nombre original al comienzo de sus actividades fue Laboratorio Argentino de Investigación Galvanotécnica.<br>Fundada 1973, su principal objetivo fue el de llevar la avanzada en la investigación, el desarrollo, y la puesta en marcha de nuevas tecnologías para el tratamiento de superficies; manifestando una marcada vocación de para el desarrollo de la industria nacional.<br><br>La innovación tecnológica, la responsabilidad social, la sustentabilidad ambiental y un decidido compromiso en búsqueda de la excelencia para la implementación de sus procesos son las premisas que nos guían.<br></span>', 'fotos/thQxie1VRsypVTKS7Lj2W9hVuTFhZZFtxHs8J48G.png', 'undefined', 'undefined', 'servicio1', '2024-05-22 15:41:44'),
	(3, 'Formulación y Desarrollo de producto', '<span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjc4NDczODY2OCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">El departamento ejecuta tareas relacionadas con el apoyo técnico y <br>da asesoramiento sobre las características, usos, pruebas y puesta <br>en marcha de cada unos de los producto que sean utilizados por nuestros clientes.<br><br>Los clientes pueden ponerse en contacto con nuestro departamento de Asistencia Técnica "cuando lo consideren necesario" y recibirán asistencia continua hasta la resolución del problema.</span>', 'fotos/JvRCk7zuIIzot2h8WMk7XIF2ZuRgPUtASbqFLpOo.png', 'undefined', 'undefined', 'servicio2', '2024-05-22 15:43:31'),
	(4, 'Sobre nosotros', '<span data-metadata="<!--(figmeta)eyJmaWxlS2V5IjoiRFoySTlTS2VFQ1RobWdIa0hCT0ZkTSIsInBhc3RlSUQiOjE4NDQyMDIxODUsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->"></span><span data-buffer="<!--(figma)(/figma)-->"></span><span style="white-space-collapse: preserve;">Real Quimica es una empresa de raíz electroquímica y su nombre original al comienzo de sus actividades fue Laboratorio Argentino de Investigación Galvanotécnica.<br>Fundada 1973, su principal objetivo fue el de llevar la avanzada en la investigación, el desarrollo, y la puesta en marcha de nuevas tecnologías para el tratamiento de superficies; manifestando una marcada vocación de para el desarrollo de la industria nacional.<br><br>La innovación tecnológica, la responsabilidad social, la sustentabilidad ambiental y un decidido compromiso en búsqueda de la excelencia para la implementación de sus procesos son las premisas que nos guían.<br></span>', 'fotos/TsaaDKcmaS0oAiE8WJKmKhKqMZtkLEFLk9rHoMF4.png', 'undefined', 'undefined', 'A', '2024-05-22 17:11:39');

